{
  "translationLines": [
    {
      "lineNumber": 117231,
      "originalJapaneseLine": "クリームのビンタでジュノーが吹っ飛んだ。",
      "translatedEnglishLine": "Juno was sent flying by a cream slap."
    },
    {
      "lineNumber": 117232,
      "originalJapaneseLine": "「アールコートさん、行きましょう！",
      "translatedEnglishLine": "\"Mr. Arlkort, let's go!"
    },
    {
      "lineNumber": 117233,
      "originalJapaneseLine": "　ふんっ！」",
      "translatedEnglishLine": "Hmph!\""
    },
    {
      "lineNumber": 117234,
      "originalJapaneseLine": "「は、はいー」",
      "translatedEnglishLine": "\"Y-Yes—\""
    },
    {
      "lineNumber": 117235,
      "originalJapaneseLine": "「あーあー、怒らせたー」",
      "translatedEnglishLine": "\"Ah-ah, I've made her angry—\""
    },
    {
      "lineNumber": 117236,
      "originalJapaneseLine": "「こ、この俺の美しい顔を叩く、なんて……」",
      "translatedEnglishLine": "\"To slap this, my beautiful face...\""
    },
    {
      "lineNumber": 117237,
      "originalJapaneseLine": "「お、キレるか？」",
      "translatedEnglishLine": "\"H-hey, are you pissed off?\""
    },
    {
      "lineNumber": 117238,
      "originalJapaneseLine": "「見てくれよ、ランス……",
      "translatedEnglishLine": "\"Look at me, Rance...\""
    },
    {
      "lineNumber": 117239,
      "originalJapaneseLine": "　頬を腫らす俺……」",
      "translatedEnglishLine": "\"My swollen cheek...\""
    },
    {
      "lineNumber": 117240,
      "originalJapaneseLine": "「美",
      "translatedEnglishLine": "\"It's bea"
    },
    {
      "lineNumber": 117241,
      "originalJapaneseLine": "、だろ？」",
      "translatedEnglishLine": "utiful,\" right?"
    },
    {
      "lineNumber": 117242,
      "originalJapaneseLine": "「男の顔は視界に入らん」",
      "translatedEnglishLine": "\"I don't look at men's faces.\""
    },
    {
      "lineNumber": 117243,
      "originalJapaneseLine": "「つれないねぇ」",
      "translatedEnglishLine": "\"So cold-hearted, huh.\""
    },
    {
      "lineNumber": 117244,
      "originalJapaneseLine": "「ほっといたらいいのに、",
      "translatedEnglishLine": "\"You should just leave him alone,"
    },
    {
      "lineNumber": 117245,
      "originalJapaneseLine": "　そいつただの馬鹿なんだから」",
      "translatedEnglishLine": "he's just a fool anyway.\""
    },
    {
      "lineNumber": 117246,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": ""
    },
    {
      "lineNumber": 117247,
      "originalJapaneseLine": "　　＜ゴソゴソ、ガサガサ……＞",
      "translatedEnglishLine": "   <Rustle, rustle...>"
    },
    {
      "lineNumber": 117248,
      "originalJapaneseLine": "「うーん、なんだぁ？」",
      "translatedEnglishLine": "\"Hmm, what's that?\""
    },
    {
      "lineNumber": 117249,
      "originalJapaneseLine": "深夜、ランスは自室で",
      "translatedEnglishLine": "Late at night, Rance was in his room"
    },
    {
      "lineNumber": 117250,
      "originalJapaneseLine": "誰かが動いてる音で目が覚めた。",
      "translatedEnglishLine": "and woke up to the sound of someone moving."
    },
    {
      "lineNumber": 117251,
      "originalJapaneseLine": "「誰かいるのかぁ？」",
      "translatedEnglishLine": "\"Is someone there?\""
    },
    {
      "lineNumber": 117252,
      "originalJapaneseLine": "「あ、めっかった」",
      "translatedEnglishLine": "\"Ah, I've been caught.\""
    },
    {
      "lineNumber": 117253,
      "originalJapaneseLine": "「……は？」",
      "translatedEnglishLine": "\"...Huh?\""
    },
    {
      "lineNumber": 117254,
      "originalJapaneseLine": "「うおおおお！？",
      "translatedEnglishLine": "\"Uwoooo!?\""
    },
    {
      "lineNumber": 117255,
      "originalJapaneseLine": "　な、なんだ、お前！」",
      "translatedEnglishLine": "\"W-who are you!\""
    },
    {
      "lineNumber": 117256,
      "originalJapaneseLine": "「えっ、きゃっ、ジュノーさん！？」",
      "translatedEnglishLine": "\"Eh, kya, Juno-san!?\""
    },
    {
      "lineNumber": 117257,
      "originalJapaneseLine": "パッと明かりをつけると、",
      "translatedEnglishLine": "When he quickly turned on the light,"
    },
    {
      "lineNumber": 117258,
      "originalJapaneseLine": "何故か笑顔のジュノーが立っていた。",
      "translatedEnglishLine": "Juno was standing there smiling for some reason."
    },
    {
      "lineNumber": 117259,
      "originalJapaneseLine": "「な、なんだ！　夜襲か！？",
      "translatedEnglishLine": "\"W-what! A night attack!?\""
    },
    {
      "lineNumber": 117260,
      "originalJapaneseLine": "「ああ、夜襲。",
      "translatedEnglishLine": "\"Yeah, a night attack."
    },
    {
      "lineNumber": 117261,
      "originalJapaneseLine": "　それも面白かったかもね」",
      "translatedEnglishLine": "That might have been fun, too.\""
    },
    {
      "lineNumber": 117262,
      "originalJapaneseLine": "「こーっそり寝てる隙に",
      "translatedEnglishLine": "\"I thought I'd sneak in while you were asleep"
    },
    {
      "lineNumber": 117263,
      "originalJapaneseLine": "　魔血魂取り返そうと思ったんだけどねー、",
      "translatedEnglishLine": "and take back the Demon Blood Soul, but—"
    },
    {
      "lineNumber": 117264,
      "originalJapaneseLine": "　失敗、失敗」",
      "translatedEnglishLine": "Failed, failed.\""
    },
    {
      "lineNumber": 117265,
      "originalJapaneseLine": "「へ？　魔血魂？」",
      "translatedEnglishLine": "\"Huh? Demon Blood Soul?\""
    },
    {
      "lineNumber": 117266,
      "originalJapaneseLine": "「あ、そういえば、",
      "translatedEnglishLine": "\"Ah, speaking of which,"
    },
    {
      "lineNumber": 117267,
      "originalJapaneseLine": "　レキシントンの魔血魂を人質に",
      "translatedEnglishLine": "you took Lexington's Demon Blood Soul as a hostage"
    },
    {
      "lineNumber": 117268,
      "originalJapaneseLine": "　部下にしたんだったな」",
      "translatedEnglishLine": "and made him your subordinate, didn't you?\""
    },
    {
      "lineNumber": 117269,
      "originalJapaneseLine": "「忘れてたの？」",
      "translatedEnglishLine": "\"Did you forget?\""
    },
    {
      "lineNumber": 117270,
      "originalJapaneseLine": "「失礼な、しっかり覚えてるぞ」",
      "translatedEnglishLine": "\"Rude! I remember it well.\""
    },
    {
      "lineNumber": 117271,
      "originalJapaneseLine": "「しかし、さすがだね……",
      "translatedEnglishLine": "\"But still, impressive...\""
    },
    {
      "lineNumber": 117272,
      "originalJapaneseLine": "　これだけ探しても魔血魂が見つかりゃしない。",
      "translatedEnglishLine": "Even after searching all this, the Demon Blood Soul can't be found."
    },
    {
      "lineNumber": 117273,
      "originalJapaneseLine": "　いったいどこに隠したんだい？」",
      "translatedEnglishLine": "\"Where on earth did you hide it?\""
    },
    {
      "lineNumber": 117274,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 117275,
      "originalJapaneseLine": "「……そりゃお前」",
      "translatedEnglishLine": "\"...Well, you see,"
    },
    {
      "lineNumber": 117276,
      "originalJapaneseLine": "「忘れてる？　忘れてるよね？」",
      "translatedEnglishLine": "\"You forgot? You did forget, didn't you?\""
    },
    {
      "lineNumber": 117277,
      "originalJapaneseLine": "「馬鹿言え……」",
      "translatedEnglishLine": "\"Don't be ridiculous...\""
    },
    {
      "lineNumber": 117278,
      "originalJapaneseLine": "「えーと、おい、シィル」",
      "translatedEnglishLine": "\"Uh, hey, Sil\""
    },
    {
      "lineNumber": 117279,
      "originalJapaneseLine": "「すみません、ランス様が絶対の秘匿事項だと、",
      "translatedEnglishLine": "\"Excuse me, but since Lord Rance said it's an absolute secret,"
    },
    {
      "lineNumber": 117280,
      "originalJapaneseLine": "　教えて下さらなかったので、私にも……」",
      "translatedEnglishLine": "he didn't tell me about it either…\""
    }
  ]
}

